import { useState } from 'react'
import logoImg  from '../../assets/logo.svg'
import Modal from 'react-modal'

import { Container, Content } from './styles'


export function Header() {

  const [ isNewTransanctionModalOpen, setIsNewTransanctionModalOpen ] = useState(false);

  function handleOpenNewTransactionModal() {
    setIsNewTransanctionModalOpen(true);
  }

  function handleCloseNewTransactionModal() {
    setIsNewTransanctionModalOpen(false);
  }

  return (
    <Container>
      <Content>
      <img src={logoImg} alt="my money logo" />
      <button type="button" onClick={handleOpenNewTransactionModal} onRequestClose={handleCloseNewTransactionModal}>
        Nova transação
      </button>

      <Modal isOpen={isNewTransanctionModalOpen}>
        <h2>Cadastrar transação</h2>
      </Modal>
      </Content>
    </Container>
  )
}
